import React from 'react'
import { Link, animateScroll as scroll } from "react-scroll";

const Menu = () => {
    return (
        <div className="menu-items d-flex justify-between align-center flex-wrap">
            <Link
                activeClass="active"
                to={whowe}
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
                className="menu-item">
                Who we
                    </Link>
            <div className="menu-item">
                Furniture
                    </div>
            <div className="menu-item">
                Accesories
                    </div>
            <div className="menu-item">
                Know Woods
                    </div>
            <div className="menu-item">
                Shop Now
                    </div>
        </div>
    )
}

export default Menu
